import React from 'react';
import { Link } from 'react-router-dom';
import './../assets/styles/Header.css';

const Header = () => (
  <header>
    <h1>Tiger Talks</h1>
    <nav>
      <Link to="/">Home</Link>
      <Link to="/profile">Profile</Link>
    </nav>
  </header>
);

export default Header;
